<!DOCTYPE html>
<head>
        <meta charset="utf-8"/>
        <title>Not Found</title>
        <meta content="Not Found" property="og:title"/>
        <meta content="Not Found" property="twitter:title"/>
        <meta content="width=device-width, initial-scale=1" name="viewport"/>
        <link href="./css/style.css" rel="stylesheet" type="text/css"/>
        <link href="https://fonts.googleapis.com" rel="preconnect"/>
        <link href="https://fonts.gstatic.com" rel="preconnect" crossorigin="anonymous"/>
        <script src="./js/font.js" type="text/javascript"></script>
        <script type="text/javascript">
            WebFont.load({
                google: {
                    families: ["Open Sans:300,300italic,400,400italic,600,600italic,700,700italic,800,800italic"]
                }
            });
        </script>
        <script type="text/javascript">
            !function(o, c) {
                var n = c.documentElement
                  , t = " w-mod-";
                n.className += t + "js",
                ("ontouchstart"in o || o.DocumentTouch && c instanceof DocumentTouch) && (n.className += t + "touch")
            }(window, document);
        </script>
        <link href="./images/ico.png" rel="shortcut icon" type="image/x-icon"/>
        <link href="./images/256x256ipad.png" rel="apple-touch-icon"/>
    </head>
    <body>
        <div class="utility-page-wrap">
            <div class="utility-page-content">
                <img src="https://cdn.prod.website-files.com/static/page-not-found.211a85e40c.svg" alt=""/>
                <h2>Page Not Found</h2>
                <div>The page you are looking for does not exist or has been moved</div>
            </div>
        </div>
        <script src="./js/jquery.js" type="text/javascript" integrity="sha256-9/aliU8dGd2tb6OSsuzixeV4y/faTqgFtohetphbbj0=" crossorigin="anonymous"></script>
        <script src="./js/code.js" type="text/javascript"></script>
    </body>
</html>
